q($,"amM","eu",()=>B.aq.zU(0,'[{"hrvatski":"Dvije plavu\u0161e kupuju karte u kazali\u0161tu: \u201eZa Hamleta?\u201c zapita ih blagajnica. \u201eNe, ne, za nas dvije!\u201c","deutsch":"Zwei Blondinen kaufen Karten im Theater: \u201eF\xfcr Hamlet?\u201c, fragt sie die Kassiererin. \u201eNein, nein, f\xfcr uns Zwei!\u201c"},{"hrvatski":"Za\u0161to plavu\u0161a zatvara o\u010di ispred ogledala? Da vidi kako izgleda dok spava!","deutsch":"Warum schlie\xdft eine Blondine ihre Augen vor dem Spiegel? Um zu sehen, wie sie aussieht w\xe4hrend sie schl\xe4ft!"},{"hrvatski":"Za\u0161to plavu\u0161a kuca po uli\u010dnom stupu? Zato jer je na stupu oglas: \u201eIznajmljuje se stan\u201c!","deutsch":"Warum klopft eine Blondine an den Stra\xdfenmast? Weil auf ihm eine Kleinanzeige steht: \u201eWohnung zu vermieten\u201c!"},{"hrvatski":"Za\u0161to je plavu\u0161a sretna kada slo\u017ei puzzle za 6 mjeseci? Jer na kutiji pi\u0161e: \u201eza 3-5 godina\u201c!","deutsch":"Warum ist eine Blondine gl\xfccklich, wenn sie ein Puzzle in 6 Monaten zusammenf\xfcgt? Weil auf der Schachtel geschrieben steht: \u201ef\xfcr 3-5 Jahre\u201c!"},{"hrvatski":"Za\u0161to plavu\u0161a nosi crne nao\u010dale na trbuhu? Jer je \u010dula da ima slijepo crijevo!","deutsch":"Warum tr\xe4gt eine Blondine eine schwarze Brille auf dem Bauch? Weil sie geh\xf6rt hat, dass sie einen Blinddarm hat!"},{"hrvatski":"Znate li za\u0161to plavu\u0161e nose ljestve u prodavnicu? Zato \u0161to su cijene visoke.","deutsch":"Wissen Sie, warum Blondinen eine Leiter in den Laden tragen? Weil die Preise hoch sind"},{"hrvatski":"\u0160to plavu\u0161a najradije radi u pustinji? Bri\u0161e pra\u0161inu!","deutsch":"Was macht eine Blondine am liebsten in der W\xfcste? Sie wischt Staub!"},{"hrvatski":"Kako plavu\u0161a lovi zeca? Stane iza drveta i zvi\u017edi kao kupus!","deutsch":"Wie jagt eine Blondine einen Hasen? Sie steht hinter einem Baum und pfeift wie ein Kohl!"},{"hrvatski":"Za\u0161to King-Kong voli plavu\u0161u? Zato \u0161to je majmun!","deutsch":"Warum liebt King-Kong Blondinen? Weil er ein Affe ist!"},{"hrvatski":"Za\u0161to plavu\u0161a dr\u017ei nao\u010dale u hladnjaku? \u017deli imati hladan pogled!","deutsch":"Warum h\xe4lt eine Blondine die Brille an den K\xfchlschrank? Sie will einen kalten Blick haben!"},{"hrvatski":"Za\u0161to plavu\u0161a stane u kut kad joj je hladno? Zato \u0161to kut ima devedeset stupnjeva!","deutsch":"Warum bleibt eine Blondine in einer Ecke stehen, wenn ihr kalt ist? Weil die Ecke neunzig Grad hat!"},{"hrvatski":"Kako potopiti podmornicu punu plavu\u0161a? Pokuca\u0161 na vrata!","deutsch":"Wie versenkt man ein U-Boot voller Blondinen? Du klopfst an die T\xfcr!"},{"hrvatski":"Za\u0161to se plavu\u0161a ne kupa? \u010ceka da se na bojleru pojavi zeleno svjetlo!","deutsch":"Warum badet die Blondine nicht? Sie wartet, dass am Boiler ein gr\xfcnes Licht erscheint!"},{"hrvatski":"Za\u0161to plavu\u0161a pere kosu na suho? Jer na \u0161amponu pi\u0161e \u201eza suhu kosu\u201c.","deutsch":"Warum w\xe4scht eine Blondine ihre Haare trocken? Weil auf dem Schampon geschrieben steht \u201eF\xfcr trockenes Haar\u201c."},{"hrvatski":"Za\u0161to plavu\u0161a hoda na prstima kad u\u0111e u ljekarnu? Da ne probudi tablete za spavanje!","deutsch":"Warum geht die Blondine auf den Zehenspitzen, wenn sie die Apotheke betritt? Damit sie die Schlaftabletten nicht aufweckt!"},{"hrvatski":"\u0160to plavu\u0161a radije \u017eeli biti: glupa ili lijepa? Glupa, ljepota je prolazna!","deutsch":"Was w\xfcrde eine Blondine lieber sein: dumm oder sch\xf6n? Dumm, Sch\xf6nheit ist verg\xe4nglich!"},{"hrvatski":"Za\u0161to plavu\u0161a stoji u du\u0107anu i otvara sva mlijeka? Zato \u0161to na mlijeku pi\u0161e: \u201eOtvori ovdje\u201c.","deutsch":"Warum steht die Blondine im Laden und \xf6ffnet die ganze Milch? Weil auf der Milch geschrieben steht: \u201eHier \xf6ffnen\u201c."},{"hrvatski":"\u0160to ka\u017ee plavu\u0161a kad \u010duje vic o plavu\u0161i? \u201eJoj, kako je glupa!\u201c","deutsch":"Was sagt eine Blondine wenn sie einen Witz \xfcber eine Blondine h\xf6rt? \u201eOh, wie dumm die ist!\u201c"},{"hrvatski":"Za\u0161to plavu\u0161a ne jede kisele krastavce? Jer ne mo\u017ee staviti glavu u teglu!","deutsch":"Warum isst eine Blondine keine sauren Gurken? Weil sie ihren Kopf nicht in das Glas stecken kann!"},{"hrvatski":"Za\u0161to plavu\u0161a prije pranja polijeva kosu uljem? Jer na \u0161amponu pi\u0161e: \u201eZa masnu kosu\u201c.","deutsch":"Warum begie\xdft eine Blondine vor dem Waschen die Haare mit \xd6l? Weil auf dem Schampon geschrieben steht: \u201eF\xfcr fettiges Haar\u201c."},{"hrvatski":"Kako plavu\u0161a radi pekmez? Guli krafne!","deutsch":"Wie macht eine Blondine Marmelade? Sie sch\xe4lt Pfannkuchen!"},{"hrvatski":"Za\u0161to plavu\u0161a dr\u017ei tenisice u kavezu? Jer na njima pi\u0161e PUMA!","deutsch":"Warum h\xe4lt eine Blondine Turnschuhe in einem K\xe4fig? Weil auf ihnen PUMA geschrieben steht!"},{"hrvatski":"\u0160to ka\u017ee plavu\u0161a kad vidi koru od banane? Joj, opet \u0107u pasti!","deutsch":"Was sagt eine Blondine, wenn sie die Schale von einer Banane sieht? Oh, ich werde wieder hinfallen!"},{"hrvatski":"Za\u0161to plavu\u0161a pere rublje na dnu mora? Jer na deterd\u017eentu pi\u0161e: \u201eDubinsko pranje\u201c.","deutsch":"Warum w\xe4scht eine Blondine die W\xe4schen auf dem Grund des Meeres? Weil auf dem Waschmittel steht: \u201eTiefenreinigung\u201c."},{"hrvatski":"Znate li koliko ima viceva o plavu\u0161ama? Niti jedan, sve je istina.","deutsch":"Wissen Sie wie viele Witze es \xfcber Blondinen gibt? Nicht einen einzigen, es ist alles wahr."},{"hrvatski":"Kako nasmijati plavu\u0161u u ponedjeljak? Ispri\u010da\u0161 joj vic u petak!","deutsch":"Wie bringt man eine Blondine am Montag zum Lachen? Du erz\xe4hlst ihr einen Witz am Freitag!"},{"hrvatski":"\u0160to ka\u017ee plavu\u0161a kad je pita\u0161 je li \u017emigavac upaljen. \u201eUpaljen je, uga\u0161en je, upaljen je, uga\u0161en je\u2026\u201c","deutsch":"Was sagt eine Blondine, wenn du sie fragst, ob das Blinklicht an ist? \u201eEs ist an, es ist aus, es ist an, es ist aus...\u201c"},{"hrvatski":"Kako \u0107e\u0161 znati da je plavu\u0161a radila na kompjutoru? Na\u0107i \u0107e\u0161 komadi\u0107e sira oko mi\u0161a!","deutsch":"Woher wirst du wissen, dass eine Blondine am Computer gearbeitet hat? Sie werden K\xe4sest\xfccke um die Maus herum finden!"},{"hrvatski":"Sto ka\u017ee plavu\u0161a s govnom u ruci? \u201eVidi u \u0161to sam zamalo stala!\u201c","deutsch":"Was sagt eine Blondine mit Schei\xdfe in der Hand? \u201eSchau, in was ich beinahe getreten w\xe4re!\u201c"},{"hrvatski":"Koja je razlika izme\u0111u plavu\u0161e i svemira? U svemiru ima nade da postoji inteligentni \u017eivot!","deutsch":"Was ist der Unterschied zwischen einer Blondine und dem Universum? Im Universum gibt es Hoffnung, dass intelligentes Leben existiert!"},{"hrvatski":"Za\u0161to se na plavu\u0161inom kompjutoru vide otisci nogu? Jer je poku\u0161avala u\u0107i na Internet!","deutsch":"Warum sind auf dem Computer einer Blondine Fu\xdfabdr\xfccke zu sehen? Weil sie versucht hat, ins Internet zu gehen!"},{"hrvatski":"Za\u0161to plavu\u0161e mijenjaju svojoj djeci jednom na mjesec pelene? Jer na paketu pi\u0161e: \u201eDo 10 kila\u201c.","deutsch":"Warum wechseln Blondinen ihren Kindern einmal im Monat die Windeln? Weil auf der Packung steht: \u201eBis 10 Kilo\u201c."},{"hrvatski":"Za\u0161to plavu\u0161a ne mijenja vodu u akvariju? Jer ribe nisu popile ni onu staru!","deutsch":"Warum wechselt die Blondine das Wasser im Aquarium nicht? Weil die Fische das alte auch nicht getrunken haben!"},{"hrvatski":"Za\u0161to plavu\u0161a baca sijeno po ulici? Hrani zebru!","deutsch":"Warum wirft eine Blondine Heu auf die Stra\xdfe? Sie f\xfcttert das Zebra!"},{"hrvatski":"Za\u0161to plavu\u0161a nosi kompjutor kod doktora? Da ga cijepi protiv virusa!","deutsch":"Warum tr\xe4gt eine Blondine den Computer zum Arzt? Um ihn gegen das Virus zu impfen!"},{"hrvatski":"Za\u0161to plavu\u0161e ne ve\u017eu cipele? Da ih br\u017ee skinu ako moraju brojiti preko deset!","deutsch":"Warum binden sich Blondinen die Schuhe nicht zu? Damit sie sie schneller ausziehen, wenn sie \xfcber zehn z\xe4hlen m\xfcssen!"},{"hrvatski":"Pi\u0161u dvije plavu\u0161e test. Nakon testa razgovaraju: \u201e\u0160to misli\u0161 kako si napisala test?\u201c \u201eLo\u0161e, predala sam prazan papir. A ti?\u201c \u201eJa sam isto predala prazan papir.\u201c \u201eO ne!!! Sigurno \u0107e misliti da smo prepisivale!\u201c","deutsch":"Zwei Blondinen schreiben einen Test. Nach dem Test unterhalten sie sich: \u201eWas denkst du, wie hast du den Test geschrieben?\u201c \u201eSchlecht, ich habe ein leeres Papier abgegeben. Und du?\u201c \u201eIch habe auch ein leeres Papier abgegeben.\u201c \u201eOh nein !!! Sicherlich werden sie denken, dass wir abgeschrieben haben!\u201c"},{"hrvatski":"Kako plavu\u0161u zaposliti satima? Na obje strane papira napi\u0161e\u0161: \u201eOkreni\u201c i da\u0161 joj da \u010dita!","deutsch":"Wie besch\xe4ftigt man eine Blondine stundenlang? Schreibe auf beide Seiten eines Papiers : \u201eUmdrehen\u201c und lass sie das lesen!"},{"hrvatski":"Zaglavile se tri plavu\u0161e u liftu. \u201eU pomo\u0107!\u201c povi\u010de prva. \u201eU pomo\u0107!\u201c povi\u010de druga. Tre\u0107a predlo\u017ei da vi\u010du zajedno. Pa povi\u010du: \u201eZajedno!\u201c","deutsch":"Drei Blondinen bleiben im Aufzug stecken. \u201eZu Hilfe!\u201c, ruft die Erste. \u201eZu Hilfe!\u201c, ruft die Zweite. Die Dritte schl\xe4gt vor, dass sie zusammen schreien. Also rufen sie: \u201eZusammen!\u201c"},{"hrvatski":"\u0160to misli plavu\u0161a da je jedna svjetlosna godina? Dvanaestomjese\u010dni ra\u010dun za struju!","deutsch":"Was glaubt eine Blondine, dass ein Lichtjahr ist? Die zw\xf6lfmonatige Rechnung f\xfcr den Strom!"},{"hrvatski":"Dvije plavu\u0161e pri\u010daju o nedavnom nestanku struje. \u201eJa sam tri sata \u010dekala u liftu da se struja vrati.\u201c \u201eMa nije to ni\u0161ta, ja sam tri sata \u010dekala na pokretnim stepenicama.\u201c","deutsch":"Zwei Blondinen sprechen \xfcber einen k\xfcrzlichen Stromausfall. \u201eIch habe drei Stunden im Aufzug gewartet, dass der Strom zur\xfcckkommt.\u201c \u201eDas ist doch gar nichts, ich habe drei Stunden auf der Rolltreppe gewartet.\u201c"},{"hrvatski":"\u0160to je plavu\u0161a kad se \u0161minka? Naivna umjetnost!","deutsch":"Was ist eine Blondine, wenn sie sich schminkt? Naive Kunst!"},{"hrvatski":"Mo\u017ee li plavu\u0161a od mu\u0161karca u\u010diniti milijuna\u0161a? Da, ali samo ako je milijarder.","deutsch":"Kann eine Blondine aus einem Mann einen Million\xe4r machen? Ja, aber nur, wenn er Milliard\xe4r ist."},{"hrvatski":"Plavu\u0161a dolazi s voza\u010dkog ispita i ka\u017ee drugoj plavu\u0161i: \u201eTo ne ku\u017eim! Do\u0161la sam do kru\u017enog toka. Na znaku je pisalo 30 i pro\u0161la sam kroz kru\u017eni tok 30 puta. Onda je instruktor rekao da sam pala.\u201c Druga plavu\u0161a odgovara: \u201eMo\u017eda si krivo brojala.\u201c","deutsch":"Eine Blondine kommt von der Fahrpr\xfcfung und sagt zu einer anderen Blondine: \u201eIch verstehe es nicht! Ich kam an einen Kreisverkehr. Auf dem Schild stand 30 und ich bin 30 Mal durch den Kreisverkehr gefahren. Dann sagte der Ausbilder, ich sei durchgefallen.\u201c Die andere Blondine antwortet: \u201eVielleicht hast du falsch gez\xe4hlt.\u201c"},{"hrvatski":"Idu dvije plavu\u0161e ulicom i na\u0111u ogledalo. Jedna ga uzme i re\u010de: \u201eVidi, moja slika!\u201c Uzme druga ogledalo i re\u010de: \u201eUh, kako si ru\u017ena!\u201c","deutsch":"Gehen zwei Blondinen die Stra\xdfe entlang und finden einen Spiegel. Eine nimmt ihn und sagt: \u201eSchau, mein Bild!\u201c Die andere nimmt den Spiegel und sagt: \u201eUh, wie h\xe4sslich du bist!\u201c"},{"hrvatski":"Pita mu\u017e svoju \u017eenu plavu\u0161u: \u201eDraga, ide li neki auto s desne strane?\u201c \u201eNe!\u201c Mu\u017e doda gas, a ona doda: \u201eIde samo neki ru\u017eni kamion!\u201c","deutsch":"Ein Mann fragt seine blonde Frau: \u201eLiebling, kommt ein Auto auf der rechten Seite?\u201c \u201eNein!\u201c Der Mann gibt Gas, und sie f\xfcgt hinzu: \u201eEs kommt nur ein h\xe4sslicher LKW!\u201c"},{"hrvatski":"\u0160to ka\u017ee plavu\u0161a kada joj ka\u017ee\u0161 da ima vakuum u glavi? \u201eBolje i\u0161ta nego ni\u0161ta!\u201c","deutsch":"Was sagt eine Blondine, wenn du ihr sagst, dass sie ein Vakuum im Kopf hat? \u201eBesser als nichts!\u201c"},{"hrvatski":"\u0160to plavu\u0161a radi naslonjena na zid \u017eeljezare? Slu\u0161a heavy metal!","deutsch":"Was macht eine Blondine, gelehnt an die Wand eines Eisenwarenladens? Sie h\xf6rt Heavy Metal!"},{"hrvatski":"Pita jedna plavu\u0161a drugu: \u201eZna\u0161 li ti \u0161to je crni humor?\u201c \u201eTo je kad se smiju dva crnca!\u201c","deutsch":"Eine Blondine fragt eine andere: \u201eWei\xdft du was schwarzer Humor ist?\u201c \u201eDas ist wenn zwei Schwarze lachen!\u201c"},{"hrvatski":"\u201e\u017delim vratiti ovu knjigu, ni\u0161ta ne valja! Previ\u0161e likova, nema radnje\u201c, \u017eali se plavu\u0161a. \u201eUkrali ste na\u0161 telefonski imenik!\u201c odgovara knji\u017eni\u010darka.","deutsch":"\u201eIch m\xf6chte dieses Buch zur\xfcckgeben, es taugt nichts! Zu viele Charaktere, keine Handlung\u201c, beschwert sich die Blondine. \u201eSie haben unser Telefonbuch gestohlen!\u201c, antwortet der Bibliothekar."},{"hrvatski":"Za\u0161to plavu\u0161a stavlja sat na ranu? Jer je \u010dula da vrijeme lije\u010di sve rane!","deutsch":"Warum legt eine Blondine eine Uhr auf eine Wunde? Weil sie h\xf6rte, dass die Zeit alle Wunden heilt!"},{"hrvatski":"Plavu\u0161a ulazi u muzej i slu\u010dajno razbije vazu staru 500 godina. \u010cuvar joj ka\u017ee: \u201eUpravo ste razbili vazu staru 500 godina!\u201c Plavu\u0161a odgovara: \u201eHvala Bogu nije bila nova!\u201c","deutsch":"Eine Blondine kommt ins Museum und zerbricht versehentlich eine 500 Jahre alte Vase. Der Aufseher sagt ihr: \u201eSie haben gerade eine 500 Jahre alte Vase zerbrochen!\u201c Die Blondine antwortet: \u201eGott sei Dank war sie nicht neu!\u201c"},{"hrvatski":"Za\u0161to plavu\u0161a kupuje bijelu boju? Za crne dane!","deutsch":"Warum kauft eine Blondine wei\xdfe Farbe? F\xfcr schwarze Tage!"},{"hrvatski":"Ulazi plavu\u0161a u prodavaonicu i pita: \u201eImate li nao\u010dale?\u201c \u201eZa sunce?\u201c \u201eNe. Za mene!\u201c","deutsch":"Eine Blondine kommt ins Gesch\xe4ft und fragt: \u201eHaben Sie eine Brille?\u201c \u201eF\xfcr die Sonne?\u201c \u201eNein. F\xfcr mich!\u201c"}]',null))
